(101, 'L\'épée en pierre', 'tips101.png', 'Cette épée est l\'une des premières de l\'aventure elle est plus efficace est plus résistante que celle en bois, elle vous sera d\'une grande aide dans les grottes avant de trouver du fer qui vous permettra d\'obtenir un meilleur équipement. Il est possible de réparer deux épées usées en les mettant dans une meule qui vous rendra une épée neuve. Les withers squelette peuvent apparaître avec une épée, et ont 8,5 % de chances de l\'abandonner en étant tuées par le joueur.', 1, '2022-12-29 23:17:24', '2022-12-29 23:24:06', 2, 1, 1, 6),
(102, 'La pioche en pierre', 'tips102.png', 'Cet objet est plus résistant et plus efficace que la pioche en bois, elle permet de miner les minerais de fer et de lapis-lazuli. Certainement la première pioche que vous emmènerez avec vous dans les grottes afin de récupérer du fer l\'élément obligatoire pour le reste de l\'aventure.', 1, '2022-12-29 23:17:57', '2022-12-29 23:24:05', 2, 1, 1, 4),
(103, 'La pioche en diamant', 'tips103.png', 'Cet objet est plus résistant et plus efficace que la pioche en fer, elle permet de miner tous les matériaux en particulier l\'obsidienne qui va vous permettre de changer totalement la suite de votre aventure. Après la pioche en diamant il n\'y a qu\'une amélioration possible qui n\'arrivera que bien plus tard alors prenez en soin.', 1, '2022-12-29 23:18:29', '2022-12-29 23:24:04', 2, 1, 3, 4),
(104, 'La hache en pierre', 'tips104.png', 'Cet objet est plus résistant et plus efficace que la hache en bois, elle permet de récolter du bois assez rapidement en début de partie. La hache en fer sera certainement c’elle qui la remplacera à part si vous avez eu beaucoup de chance durant le minage pour avoir une hache en diamant.', 1, '2022-12-29 23:18:58', '2022-12-29 23:24:03', 2, 1, 1, 4),
(105, 'La houe en pierre', 'tips105.png', 'Cet objet est plus résistant et plus efficace que la houe en bois, elle permet de labourer la terre assez rapidement en début de partie. A partir de ce moment vous serez en mesure d’avoir des champs afin de récolter de la nourriture obligatoire pour votre survie. La houe en fer sera certainement c’elle qui la remplacera à part si vous avez eu beaucoup de chance durant le minage pour avoir une houe en diamant.', 1, '2022-12-29 23:19:30', '2022-12-29 23:24:02', 2, 1, 1, 4),
(106, 'Le bouclier', 'tips106.png', 'Les boucliers sont utilisés pour bloquer. Le blocage s’active en maintenant le clic droit enfoncé, avec le bouclier équipé (en main principale ou secondaire). Le joueur est alors ralenti (il avance aussi vite que s’il était accroupi) et les dégâts reçus sont amortis par le bouclier. Lorsque le bouclier reçoit un coup sa durabilité diminue, il peut parer les coups d’épée, de flèche et les boules de feu mais pas les explosions et les flammes.', 1, '2022-12-29 23:20:06', '2022-12-29 23:24:01', 2, 1, 1, 4),
(107, 'L\'établie ', 'tips107.png', 'C’est l’un si ce n’est la première chose à crafter, avec seulement 4 planches de bois vous obtiendrez l’établie. En cliquant sur ce bloc une interface s’ouvrira et vous permettra de crafter une quantité impressionnante d’objet et de bloc. Pour vous aider dans les crafts un petit livre vert se trouvera dans un coin de l’interface, il vous donnera tous ce que vous pouvez crafter avec les matériaux dans votre inventaire.', 1, '2022-12-29 23:20:42', '2022-12-29 23:24:00', 2, 1, 1, 5),
(108, 'Le coffre ', 'tips108.png', 'C’est l’un des blocs les plus indispensable de Minecraft grâce à sa capacité de stocker n’importe quoi. Quand l’on pose deux coffres l’un à côté de l’autre ils fusionnent automatiquement et par conséquent à une capacité de stockage deux fois plus importante qu’un coffre unique. Attention lorsque vous cassez un coffre tout le contenue de celui-ci drop par terre.', 1, '2022-12-29 23:21:16', '2022-12-29 23:24:00', 2, 1, 1, 5),
(109, 'La table d\'enchantement', 'tips109.png', 'Il permet tout simplement d’enchanter vos objets et votre armure les rendant bien plus efficaces. Afin de faire fonctionner cette table vous aurez besoin de lapis-lazuli et de niveaux d’expérience indispensable pour enchanter n’importe quoi. Si vous souhaitez améliorer les enchantements proposés par la table il suffit de poser des bibliothèques à un bloc d’écart de la table. Cela aura pour effet d’améliorer les enchantements en contrepartie d’un plus grand nombre de niveaux d’expérience requis. Si vous souhaitez la casser pour la déplacer il vous faudra au minimum une pioche en diamant.', 1, '2022-12-29 23:22:03', '2022-12-29 23:23:59', 2, 1, 3, 5),
(110, 'Perle de l\'ender', 'tips110.png', 'Cette perle que l’on récupère en tuant des endermen permet de ce téléporté là où elle a astérie. Elle est aussi utile pour la création de l’œil de l’ender qui nous permettra de trouver et d’activé le portail vers la dimension de l’end une étape obligé pour finir le jeu.', 1, '2022-12-29 23:22:40', '2022-12-29 23:23:57', 2, 2, 2, 7),
(111, 'La poudre à canon', 'tips111.png', 'La poudre à canon est une ressource assez facile à trouver car plusieurs créatures nous la drop quand on les tues et on peut aussi la récupérer dans des structure tel que les donjons et les épaves. C’est créature sont le creeper, le ghast ou la sorcière mais tous ces adversaires sont redoutables alors faites attention. La poudre à canon permet de crafter des TNT, des feux d’artifice et des boules de feu.', 1, '2022-12-29 23:23:23', '2022-12-29 23:23:56', 2, 2, 1, 1);
